INSERT INTO `cloud_app` VALUES (1,'EduSoho主系统','MAIN','plugin',2,'EduSoho主系统','','8.0.14','8.0.14',1,'EduSoho官方','0.0.0','up',1490843361,1497252701),(5,'账户充值','ChargeCoin','plugin',3,'EduSoho官方应用，基于网校虚拟币体系，提供网校用户充值虚拟币的功能，完善虚拟币体系。','','1.2.6','0.0.0',0,'EduSoho官方','0.0.0','up',1491530501,1491530501),(6,'学习卡','MoneyCard','plugin',3,'可以使用学习卡充值账户虚拟币，扩展虚拟币的充值渠道，增强网校虚拟币的营销属性','','3.0.0','0.0.0',0,'EduSoho官方','0.0.0','up',1491547884,1491547884),(7,'优惠码','Coupon','plugin',3,'在为如何推广您的优质课程而烦恼吗？“优惠码”能够祝您一臂之力！众多功能让您轻松制作出个性优惠码！再通过各种渠道将您的优惠码发放出去。','','2.1.6','0.0.0',0,'EduSoho官方','0.0.0','up',1491814049,1491814049),(10,'会员专区','Vip','plugin',3,'“会员专区”是EduSoho官方推出的第一个应用插件，通过分组机制，能满足对不同群体的用户提供不同课程的需要。会员专区的主要功能有：支持会员用户组自定义、会员可购买/可续费/可升级、支持会员专属课程等等。会员专区能够灵活的运用于多种应用场景，例如会员制、用户分组课程等，满足您的“私人订制”需要！','','1.7.0','0.0.0',0,'EduSoho官方','0.0.0','up',1494665218,1494665218),(11,'雅致简洁','GracefulTheme','plugin',3,'EduSoho官方出品的商业主题，使用时下流行的扁平化UI设计，让您的网校立即焕然一新。','','1.5.0','0.0.0',0,'EduSoho官方','0.0.0','up',1496624894,1496624894),(14,'用户导入导出','UserImporter','plugin',3,'用户导入导出允许用户批量导入用户数据，不必逐个添加。需要按照给定的格式来组织待导入的数据，并且也提供将网校注册用户信息批量导出方便运营推广。','','2.2.2','0.0.0',0,'EduSoho官方','0.0.0','up',1496731367,1496731367);
